[PixAndVideo] Nesty (Christmas Treat / 200356 / 12.24.2013)

The first snow is down already, cold wind dances outside the door, hoarfrost draws fabulous pattern on the window... Christmas is here again. It is a real treat to stay inside at the warmth of the fireplace with a hot cup of tea in our hand, munching gingerbread... especially, if the treat involves such a cute 'Santa's girl' like Nesty.

